import React, { PureComponent } from 'react';
import { DetailWrapper, Header, Content } from './style';

export default class Detail extends PureComponent {
    render() {
        return <DetailWrapper>
            <Header>乔碧萝在B站复出立刻遭封杀，理由是身份认证与实际主播不符</Header>
            <Content>
                <div className="pic-div">
                    <img src="https://images.unsplash.com/photo-1489595812352-d3db436c102b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=400&q=60" alt=''></img>
                </div>
                <p>200年后，人类从废墟中发现一个满尘埃的硬盘，解码其中的数据，会发现在他们祖宗的世界，不但美可以受人追捧，丑也行。</p>
                <br/>
                <p>乔碧萝殿下在遭斗鱼封禁后，偷偷去了B站开直播。</p>
                <br/>
                <p>结果开播仅一个小时收礼主播等级就达到37级，人气超百万。</p>
            </Content>
        </DetailWrapper>;
    }
}
